import "./App.css";

function App() {
  return (
    <div className="App">
      <i class="fa-regular fa-face-smile fa-4x l"></i>
      <i class="fa-solid fa-image fa-4x l"></i>
      <i class="fa-solid fa-square-poll-vertical fa-4x l"></i>
      <i class="fa-solid fa-gif fa-4x d"></i>
    </div>
  );
}

export default App;
